import React from "react";
import "./App.css";
import { Footer } from "./components/Footer";
import { SideBar } from "./components/SideBar";
import { Header } from "./components/Header";

function App() {

  return (
    <div className="App">
      <Header />
      <SideBar />
      <Footer />
    </div>
  );
}

export default App;
